import style from "./OptionTime.module.css";

function OptionTime(props) {
  return (
    <div className={style.time}>
      <p>Select Time</p>
      <div className={style["time__container"]}>
        <label>Starting Date</label>
        <input type="date" />
      </div>
      <div className={style["time__container"]}>
        <label>Ending Date</label>
        <input type="date" />
      </div>
    </div>
  );
}

export default OptionTime;
